import Formulario from "./Formulario"
import { BrowserRouter, Routes, Route } from "react-router-dom"
import App from "./App";

function AppRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />}>
          <Route path="formulario" element={<Formulario />}></Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default AppRoutes;
